import React from 'react';
import './projects.css';
import FTA from './images/portfolio/from'

class Projects extends React.Component {
    render() {
        return (
            <div className="pjs-holder">
                <div className="row">
                    <div className="col-sm-4">
                        <a href="http://fromtheashesent.com/" target="_blank">FTA</a>
                    </div>
                    <div className="col-sm-4">
                        <a href="https://dloft1991.github.io/Collection-game/" target="_blank">Collection Game</a>
                    </div>
                    <div className="col-sm-4">
                        <a href="https://dloft1991.github.io/RPS1.0/" target="_blank">RPS</a>
                    </div>
                </div>
            </div>
        )
    }
}

export default Projects;
